  };

  render() {
    return (
      <div>
        <input
          type="text"
          value={this.state.fieldValue}
          onChange={this.handleChange}
        ></input>
        <button onClick={this.getDetails}>Get Detail</button>
      </div>
    );
  }
}

export default App;
